        <title>LatinMotto</title>

        <style type="text/css">
            html,body {
                padding: 0;
                margin: 0;
                height: 100%;
                width: 100%;
                background: #f5f5f5;
                display: flex;
                flex-direction: column;
                align-items: center;
                justify-content: center;
            }
            .img-top {
                width: 100%;
            }
            .img-top img {
                width: 100%;
            }
            .app-logo {
                width: 100%;
                padding: 40px 0 10px 0;
                box-sizing: border-box;
                display: flex;
                justify-content: center;
            }
            .app-logo img {
                width: 140px;
                height: 140px;
            }

            .app-content {
                width: 100%;
                display: flex;
                justify-content: center;
                align-items: center;
                margin-bottom: 20px;
            }
            .app-content img {
                height: 24px;
                
            }
            .app-content p {
                font-size: 20px;
                padding: 0;
                margin: 0;
                color: #333333;
            }

            .item {
                display: flex;
                justify-content: flex-start;
                align-items: center;
                box-sizing: border-box;
                padding: 0 12px;
                height: 48px;
                background: #ffffff;
                font-size: 14px;
                margin-bottom: 1px;
            }
            .item-label {
                width: 30%;
                color: #666666;
            }
            .item-content {
                color: #333333;
            }
            .copy-right {
                position: absolute;
                width: 100%;
                padding: 0 12px;
                box-sizing: border-box;
                display: flex;
                flex-direction: column;
                bottom: 80px;
                font-size: 12px;
                color: #999999;
                display: flex;
                justify-content: center;
                align-items: center;
                flex-wrap: wrap;
            }
            .page-wrapper {
                width: 66%;
                height: 100%;
            }
        </style>
